u32 pi_function(u32 i) {
	u32 ret = 0UL;
	u32 e;
	u32 mod;

	if ((i & 0xffff0000UL) == 0) {
		// have to special case the first bucket because of 2 & 3
		if (i < 5UL) {
			switch (i) {
			case 0:
			case 1:	return(0UL);
			case 2: return(1UL);
			case 3:
			case 4: return(2UL);
			}
		}
		ret = 2UL;
		e = 5UL;
	} else {
		ret = __plookuppi[i >> 16];
		e = (i & 0xffff0000UL) + 1UL;
	}

	mod = (e % 6);
	if (mod > 1) {
		e += (5 - mod);
		goto mod5;
	}

	while (e <= i) {
		if (isprime(e))
			++ret;
		e += 4;
mod5:
		if (e > i)
			return(ret);
		if (isprime(e))
			++ret;
		e += 2;
	}

	return(ret);
}

u32 nth_prime(u32 i) {
	u32 c;
	unsigned int ixl, ixh, ix;
	unsigned int e;

	if (i == 0)
		return(0);

	// binary search on the pi(x) lookup table: find the last
	// entry that is _strictly_ smaller than i
	ixl = 0;
	ixh = 0xFFFF;
	for (;;) {
		ix = (ixl + ixh) >> 1;
		if (__plookuppi[ix] < i)
			ixl = ix;
		else
			ixh = ix - 1;

		if (ixh <= ixl) {
			if (ixh == 0xFFFF)
				break;
			if (__plookuppi[ixl] < i)
				ix = ixl;
			else if (__plookuppi[ixh + 1] < i)
				ix = ixh + 1;
			else
				ix = ixh;
			break;
		} else if (ixl + 1 == ixh) {
			if (__plookuppi[ixh] < i)
				ix = ixh;
			else
				ix = ixl;
			break;
		}
	}

	c = __plookuppi[ix];
	e = (ix << 16);

	for (;;) {
		e = next_prime(e);
		++c;
		if (c >= i)
			return(e);
		if (e == 0)
			break;
	}

	return(0);
}

u32 next_prime(u32 i) {
	unsigned int j;
	unsigned int mod;

	if (i < 2)
		return(2);
	if (i == 2)
		return(3);

	j = i;

	mod = (i % 6);
	switch (mod) {
	case 5:
		++i;
		// fallthrough
	case 0:
		++i;
		break;
	case 1:
		++i;
		// fallthrough
	case 2:
		++i;
		// fallthrough
	case 3:
		++i;
		// fallthrough
	case 4:
		++i;
		goto mod5;
	}

	for (;;) {
		if (i < j)
			break;
		if (isprime(i))
			return(i);
		i += 4;
mod5:
		if (i < j)
			break;
		if (isprime(i))
			return(i);
		i += 2;
	}

	return(0);
}

u32 previous_prime(u32 i) {
	unsigned int mod;

	if (i == 5)
		return(3);
	if (i == 3)
		return(2);
	if (i <= 2)
		return(0);

	mod = (i % 6);
	switch (mod) {
	case 1:
		--i;
		// fallthrough
	case 0:
		--i;
		break;
	case 5:
		--i;
		// fallthrough
	case 4:
		--i;
		// fallthrough
	case 3:
		--i;
		// fallthrough
	case 2:
		--i;
		goto mod1;
	}

	for (;;) {
		if (isprime(i))
			return(i);
		i -= 4;
mod1:
		if (isprime(i))
			return(i);
		i -= 2;
	}

	return(0);
}

